import { PostCard } from './components/PostCard';


export const Posts = () => (
    <div className="posts">
          {posts.map(post => (
            <PostCard 
            key={post.id}  
            title={post.title}
            body={post.body}
            cover={post.cover}   
            />
          ))}
        </div>
);
